const App=()=>{
return(
  <>
<Routes>
  <Route   path="/about"  componet={about} />
  <Route   path="/about"  componet={About} />
  <Route   path="/service"  componet={Service} />
  <Route   path="/contact"  componet={Contact} />
  <Home/>
  </Routes>
  </>
);
}

export default App;
